import React, { useRef, useState } from "react";
import { IoIosSearch } from "react-icons/io";
import "../css/webBrowser.css";


const WebBrowser = () => {
  const [url, setUrl] = useState();
  
  const updateUrl = (event) => {
    event.preventDefault();
    setUrl(event.target.value);
  }

  return (
    <div>
      <div className="frame">
        <div className="search-div">
          <input type="text" onChange={updateUrl}></input>  
          <button className="search"><IoIosSearch /></button>
        </div>
        <iframe src="https://www.pids.gov.ph/details/news/in-the-news/educational-challenges-in-the-philippines"></iframe>
      </div> 
      <div>
        
      </div>
    </div>
  );
};

export default WebBrowser;
